import { deleteProject } from '../../ProjectsPageScripting';
import { projectsList } from '../../ProjectClass';

function DeleteProjectModal(props) {
    return(
        <div className="DeleteProjectModal">
            <div className="ModalBackground">
                <div className="ModalContainer">
                    <h1>{"Are You Sure You Want To Delete Project: " + projectsList[props.projectId].name + "?"}</h1>
                    <button onClick={() => {deleteProject(props.projectId);}}>Confirm</button>
                    <button >Cancel</button>
                </div>
            </div>
        </div>
    );
}

export default DeleteProjectModal;
